(window.webpackJsonp=window.webpackJsonp||[]).push([[6],{861:function(n,a,e){"use strict";e.r(a),e.d(a,"default",function(){return E});var s=e(33),t=e.n(s),o=e(34),i=e.n(o),r=e(35),p=e.n(r),l=e(36),c=e.n(l),u=e(45),h=e.n(u),d=e(37),f=e.n(d),m=e(38),g=e.n(m),k=e(773),y=e.n(k),v=e(0),b=e.n(v),w=e(195);function S(n){return b.a.createElement(n.tag,y()({},n.attributes,{dangerouslySetInnerHTML:{__html:n.html}}))}function z(n){return b.a.createElement(S,{tag:"section",html:n.html,attributes:{className:"zandoc-react-markdown"}})}function j(n){return b.a.createElement(S,{tag:"style",html:n.style})}v.Component;var E=function(n){function a(){return t()(this,a),p()(this,c()(a).apply(this,arguments))}return f()(a,n),i()(a,[{key:"componentDidMount",value:function(){var n=location.hash;if(n){var a=document.querySelector('a[href="'.concat(n,'"]'));a&&Object(w.a)(document.documentElement,0,function n(a,e){for(;a;)return a.offsetTop&&"static"!==getComputedStyle(a).position&&(e+=a.offsetTop),n(a.parentNode,e);return e}(a,-9))}}},{key:"render",value:function(){return b.a.createElement("div",{className:"zandoc-react-container",key:null},b.a.createElement(j,{style:'img[alt="zent-components"] {\n  width: 523px;\n  height: 435px;\n}'}),b.a.createElement(z,{html:'<h1 class="anchor-heading"><a href="#zent">¶</a><a href="javascript:void(0)" id="zent" class="anchor-point"></a>Zent</h1>\n<p>Zent ( \\ˈzent\\ ) is a React component library developed and used at Youzan. Zent provides a collection of essential UI components and lots of useful domain specific components.</p>\n<p>We have more than 50 components for now and we\'re releasing more.</p>\n<p>Our goal is making React development faster and simpler.</p>\n<h3 class="anchor-heading"><a href="#showcase">¶</a><a href="javascript:void(0)" id="showcase" class="anchor-point"></a>Showcase</h3>\n<p><img src="https://img.yzcdn.cn/public_files/2018/04/17/ab32128950146c5932c267cbc19f9363.png" alt="zent-components"></p>\n<h3 class="anchor-heading"><a href="#features">¶</a><a href="javascript:void(0)" id="features" class="anchor-point"></a>Features</h3>\n<ul>\n<li>High quality React components</li>\n<li>Builtin TypeScript support</li>\n<li>Supports custom themes</li>\n<li>Import JavaScript and styles only if they are used</li>\n<li>Handmade icon font</li>\n</ul>\n<h3 class="anchor-heading"><a href="#supported-environments">¶</a><a href="javascript:void(0)" id="supported-environments" class="anchor-point"></a>Supported Environments</h3>\n<ul>\n<li>React >= 16.8</li>\n<li>Supports server-side rendering(SSR)</li>\n</ul>\n<h3 class="anchor-heading"><a href="#browsers">¶</a><a href="javascript:void(0)" id="browsers" class="anchor-point"></a>Browsers</h3>\n<ul>\n<li>Firefox >= 52(ESR)</li>\n<li>Chrome >= 49</li>\n<li>Safari >= 9.1</li>\n<li>No IE support</li>\n</ul>\n<h4 class="anchor-heading"><a href="#polyfills-needed-for-supported">¶</a><a href="javascript:void(0)" id="polyfills-needed-for-supported" class="anchor-point"></a>Polyfills needed for supported browsers</h4>\n<ul>\n<li>String.prototype.padStart (Chrome 57, Safari 10)</li>\n</ul>\n<h4 class="anchor-heading"><a href="#other-browsers">¶</a><a href="javascript:void(0)" id="other-browsers" class="anchor-point"></a>Other browsers</h4>\n<p>For CSS, please refer to <a href="theme">Themes</a></p>\n<p>Possibly needed polyfills:</p>\n<ul>\n<li>Map</li>\n<li>Set</li>\n<li>Array.prototype.includes</li>\n<li>String.prototype.includes</li>\n<li>Object.assign</li>\n<li>Object.is</li>\n</ul>\n<h3 class="anchor-heading"><a href="#install">¶</a><a href="javascript:void(0)" id="install" class="anchor-point"></a>Install</h3>\n<pre><code class="language-bash">yarn add zent</code></pre>\n<h3 class="anchor-heading"><a href="#using-components">¶</a><a href="javascript:void(0)" id="using-components" class="anchor-point"></a>Using Components</h3>\n<pre><code class="language-jsx"><span class="token keyword">import</span> <span class="token punctuation">{</span> Button <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'zent\'</span><span class="token punctuation">;</span>\n\n<span class="token comment">// Import style</span>\n<span class="token keyword">import</span> <span class="token string">\'zent/css/index.css\'</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span><span class="token tag"><span class="token tag"><span class="token punctuation">&#x3C;</span>Button</span> <span class="token punctuation">/></span></span><span class="token punctuation">,</span> mountNode<span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<h3 class="anchor-heading"><a href="#import-as-necessary">¶</a><a href="javascript:void(0)" id="import-as-necessary" class="anchor-point"></a>Import as Necessary</h3>\n<p><a href="babel-plugin-zent">babel-plugin-zent</a> is a babel plugin that can help reduce bundle size, it does code transformations like this:</p>\n<pre><code class="language-js"><span class="token keyword">import</span> <span class="token punctuation">{</span> Button <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'zent\'</span><span class="token punctuation">;</span>\n\n<span class="token comment">// Transforms into</span>\n\n<span class="token keyword">import</span> Button <span class="token keyword">from</span> <span class="token string">\'zent/lib/button\'</span><span class="token punctuation">;</span></code></pre>\n<p>This plugin is useful if you are developing a library based on Zent, or if you only use a small part of Zent components.</p>\n<p>You can find detailed instructions in its <a href="babel-plugin-zent">documentation</a>.</p>\n<p>Using ESM with tree-shaking enabled bundler is also possible.</p>'}))}}]),a}(v.Component)}}]);